                            d'une voiture neuve dernier cri ou simplement à la recherche d'inspiration,
                            vous êtes au bon endroit. </p>
                    </div>
                    <div className='buttAcc'>
                        Connexion 
                    </div>
                </div>
            </div>
            <p>Coucou</p>
            </>
        );
    }
}

export default Accueil;
